import styled from "styled-components";

export const Wrap = styled.div`
  width: 100%;
  top: 0;
  z-index: 99;
  background-color: #ffffff;
  padding: 10px 20px;
`;

export const Logo = styled.img`
  width: 95px;
  height: 35px;
`;
